import React from 'react';
import Input from '@material-ui/core/Input';

class NewNameInput extends React.Component {
    render() {
        return(
            <Input
                startAdornment={<InputAdornment position="start">$</InputAdornment>}
              />
        );
    }
}

export default NewNameInput;
